import React, { useState } from "react";
import "./App.css";
import ALayout from "./components/aLayout";
import TestContentPanel3 from "./components/testContentPanel3";
import ThemeProvider from "@material-ui/core/ThemeProvider";
import { createTheme } from "@material-ui/core/styles";

const theme = createTheme({
  palette: {
    primary: {
      main: purple[500],
    },
    secondary: {
      main: green[500],
    },
  },
});

function App() {
  return (
    <ThemeProvider>
    <div className="App">
      <ALayout contentPanel={<TestContentPanel3 />} />
    </div>
    </ThemeProvider>
  );
}

export default App;
